import styled from "styled-components";
import { Formik, Field, Form, useField, FieldAttributes} from "formik"
import { TextField, Button, Checkbox, FormControlLabel,Radio } from "@material-ui/core";

const TestWrapper = styled.div`
  width:100%;
  height:100%;
  display:flex;
  flex-flow: row wrap;
`;

interface Props { 

}

type RadioProps = { label: string } & FieldAttributes<{}>;

const LabeledRadio: React.FC<RadioProps> = ({ label, ...rest }) => {
  const [field,] = useField(rest);
  return (
    <FormControlLabel control={<Radio />} label={label} {...field} />
  )
} 


const LabeledCheckbox: React.FC<RadioProps> = ({ label, ...rest }) => { 
  const [field,] = useField(rest);
  return (
    <FormControlLabel control={<Checkbox />} label={label} {...field} />
  )
}

const Test = ({  }:Props):JSX.Element=> {

  return (
    <TestWrapper>
      <Formik initialValues={{ text: "", isbool:false, checks:[], nation:'' }} onSubmit={(data, { setSubmitting }) => {
              setSubmitting(true) 
        console.log(data)


              setSubmitting(false) 
            }}>

            { 
                ({ isSubmitting }) => (
                <Form> 
                      <div>
                        <Field name="text" as={TextField} /> 
                    </div>
                    <div>
                        <Field name="isbool" as={Checkbox} />  
                    </div>
                    <div>
                      <LabeledCheckbox name="checks" value="React" label="Korea" type="checkbox" />
                      <LabeledCheckbox name="checks" value="React" label="Korea" type="checkbox" />
                      <LabeledCheckbox name="checks" value="React" label="Korea" type="checkbox" />
                      <LabeledCheckbox name="checks" value="React" label="Korea" type="checkbox" />
                    </div>
                    <div>
                      <div>

                        <LabeledRadio name="nation" value="Korea" label="Korea" type="radio" />
                        <LabeledRadio name="nation" value="Japan" label="Japan" type="radio" />
                        <LabeledRadio name="nation" value="China" label="China" type="radio" />
                      </div>
                    </div>

                      <Button type="submit" disabled={isSubmitting}>Submit</Button>
                </Form>
                ) 
              }

            </Formik>
    </TestWrapper>
  )

}

export default Test;
